import React from 'react';
import './Footer.css';
import { Button } from './Button';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <div className='footer-container'>
      <section class='social-media'>


            <Link to='/' className='social-logo'>
              Azakana
              <i class='' />
            </Link>


      
      </section>
    </div>
  );
}

export default Footer;
